import React from 'react';
import {StyleSheet} from 'react-native';
import {Icon, Panel, PanelGroup} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';

export type FaqVProps = {
  faqData?: any[];
  title?:any;
  headingStyle?:any;
  iconStyle?:any;
  width?:any;
};



const faqV = (props: FaqVProps) => {
  const output: any = [];
  const getFaq = () => {
    Array.isArray(props?.faqData) && props?.faqData.forEach(items => {
        output.push(
        <Panel header={<span ><Icon icon={items.icon} style={StyleSheet.flatten([props?.iconStyle])} />{items?.question}</span>}>{items?.answer}</Panel>

        );
      });
    return output;
  };

  return (
    <div style={props?.title}>
        <h3 style={StyleSheet.flatten([props?.headingStyle])}>{props?.title?.heading}</h3>
    <PanelGroup accordion bordered >
      {getFaq()}
    </PanelGroup>
    </div>
  );
};

export default faqV;
